def _xor(parts):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), parts)

_KEY = _xor([b'\xb2\x98\xe8-J\xeen\x10S\xf7\xfdk\x14\xee\xbd\x7fSv\x8a\xc4[m\xcd/\x9b\xe1\xa5\xaf$fZ\x08', b'.T\xb0e-\x1a\xe0\xac\xf7\xc1\x05\xdd5?=\n\x1d7\x89\xbfvJ8n\x10\x87\x1c\xbb\x05\xcf\xaa\xc5', b'\x1dw\x0cgO\xd6CZ\xf4\x0ci]\xfd\xec\xdco\xee\xfb\xdb\x15\x82B\xe8\xc5\x88\x0fJO\xdcW!\xa9'])
